import React, { Component } from "react";
import "./App.css";
import { ToggleButton } from "react-bootstrap";
import { ToggleButtonGroup } from "react-bootstrap";

function App() {
  return (
    <div className="App">
      <ToggleButtonGroup type="checkbox" defaultValue={[1, ]}>
        <ToggleButton value variant="outline-primary" size="lg">
          +
        </ToggleButton>
        <ToggleButton value variant="outline-danger" size="lg">
          -
        </ToggleButton>
      </ToggleButtonGroup>
    </div>
  );
}

export default App;
